INSERT INTO `tdatacode` VALUES (1,1,'1-0차','2025-01-18','1. Table 수량 및 Object 수량은 AS-Is 와 To-Be 동일함.\r\n2. Index 수량은 As-Is 대시 To-Be에서 증가(성능 향상 및 사용자 요청)\r\n3. As-Is의 Invalid Object는 To-Be에서 발견되지 않음.','1.As-is Table의 주요 컬럼(숫자)에 대한 SUM값 대비 To-Be 비교시 동일함.\r\n2. Xxx Table의 SUM값 비교 시 차이가 있음 - 이러저러한 사유료'),(2,1,'1-1차','2025-01-21','1. Table 수량 및 Object 수량은 AS-Is 와 To-Be 동일함.\r\n2. Index 수량은 As-Is 대시 To-Be에서 증가(성능 향상 및 사용자 요청)\r\n3. As-Is의 Invalid Object는 To-Be에서 발견되지 않음.','1.As-is Table의 주요 컬럼(숫자)에 대한 SUM값 대비 To-Be 비교시 동일함.\r\n2. Xxx Table의 SUM값 비교 시 차이가 있음 - 이러저러한 사유료');
